def get_dnum(num, caps=True, prefix=True):
    if isinstance(num, int):
        if caps:
            if prefix:
                return 'DET' + str(num).zfill(2)
            else:
                raise ValueError("Cannot have 'caps' as True and 'prefix' as False.")
        else:
            if prefix:
                return 'det' + str(num).zfill(2)
            else:
                raise ValueError("Cannot have 'caps' as False and 'prefix' as False.")
    elif isinstance(num, str):
        if num.isdigit():
            if caps:
                return 'DET' + num.zfill(2)
            else:
                return 'det' + num.zfill(2)
        else:
            raise ValueError("Invalid input. The argument 'num' should be an integer or a string representing an integer.")

