def traverseShortestPath(target):

    vertexes_in_path = []

    while target.previous:
        vertexes_in_path.append(target.vert_id)
        target = target.previous

    return vertexes_in_path

def rot(n, x, y, rx, ry):

    if ry == 0:
        if rx == 1:
            x = (n - 1) - x;
            y = (n - 1) - y;

        # Swap x and y:
        t = x;
        x = y;
        y = t;

    return x, y

