from math import sin, cos, radians

def rot(x, y, z, theta):
    theta = radians(theta)
    new_x = x * cos(theta) - y * sin(theta)
    new_y = x * sin(theta) + y * cos(theta)
    new_z = z
    return (new_x, new_y, new_z)

def test_rot():
    assert rot(5, 1, 2, 1, 0) == (2, 3)

