def norm_nonFara_Q_C(Rs, Q, n, L="none"):

    if L == "none":
        C_eff = (Q * Rs ** (1 - n)) ** (1 / n)
    else:
        C_eff = ((Q * L) * Rs ** (1 - n)) ** (1 / n)
    return C_eff

