import torch

def diagonalize_gain(input: torch.Tensor):

    assert (
        input.ndim == 1 or input.ndim == 2
    ), "Input gain has to be 1 or 2 dimensional tensor!"
    if input.ndim == 1:
        return torch.diag(input)
    else:
        return input

def factorize(n):

    fct = []  # prime factor
    b, e = 2, 0  # base, exponent
    while b * b <= n:
        while n % b == 0:
            n = n // b
            e = e + 1
        if e > 0:
            fct.append((b, e))
        b, e = b + 1, 0
    if n > 1:
        fct.append((n, 1))
    return fct

