def solve(_n, tree):


    _i, _j = 0, 0
    count = 0

    _col = len(tree[0])

    while _i + 1 < _n:
        _j = (_j + 3) % _col
        _i += 1
        if tree[_i][_j] == "#":
            count += 1

    return count

def top1accuracy(pred, target):

    batch_size = target.size(0)

    correct = pred.eq(target).float().sum(0)
    return correct.mul_(100.0 / batch_size)

