def rotate_letter(letter, rotation):


    # invalid input
    if len(letter) != 1:
        return letter
    # letter is not in alphabet
    elif not letter.isalpha():
        return letter
    else:
        letter = letter.upper()
        ordv = ord(letter)
        ans = ((ordv - 65 + rotation) % 26) + 65
        return chr(ans)

