import numpy

def fftdeconvolve(image, kernel):

    x = numpy.fft.fftshift(numpy.fft.fftn(image))
    y = numpy.fft.fftshift(numpy.fft.fftn(kernel))

    return numpy.real(numpy.fft.fftshift(
        numpy.fft.ifftn(numpy.fft.ifftshift(x / y))))

