import torch

def complex_to_mag_phase(data):


    assert data.size(-3) == 2
    mag = (data ** 2).sum(dim=-3).sqrt()
    phase = torch.atan2(data[:, 1, :, :], data[:, 0, :, :])
    return torch.stack((mag, phase), dim=-3)

