def asint(value, minimum=None, maximum=None):
    if value is None:
        raise ValueError("Input cannot be None")

    result = int(value)

    if minimum is not None:
        if result < minimum:
            result = minimum
    if maximum is not None:
        if result > maximum:
            result = maximum

    return result

