    assert merge_two_dicts({'a': 1}, {'a': 2}) == {'a': 2}

    # case 7: when x and y have common keys with different values
    assert merge_two_dicts({'a': 1, 'b': 2}, {'a': 3, 'c': 4}) == {'a': 3, 'b': 2, 'c': 4}
